import axios from "axios";

async function loginUser(email, password) {
    try {
        const loginRes = await axios.post("http://localhost:8081/api/users/login", {
            email,
            password,
        });

        return loginRes.data;
    } catch (err) {
        throw err;
    }
}

export { loginUser };
